import React, { Component } from "react";
import '../../App.css';
import Drawer from '@material-ui/core/Drawer';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import * as videoStyles from  "../../styles/video";
import * as drawerStyles from "../../styles/drawer";



class Home extends Component {

    constructor(props){
        super(props);       
    }
 
  


    render() {
        var date = (new Date().getMonth() + 1) + "/" + new Date().getDate() + "/" + new Date().getFullYear();
        var location = "San Jose";
        var camera = "Camera #1";
        return (
        <>
        <Drawer style={drawerStyles.drawer} variant="permanent" anchor="left">
        <div style={drawerStyles.topItem}><center>
        <div>Real-Time Video Analytics</div>
        <div>for Threat Detection</div></center></div>
        <Divider />
          <List>
          {['LIVE SURVEILLANCE', 'SURVIELLANCE HISTORY', 'DAILY SUMMARY', 'THREAT ANALYTICS' , 'SETTINGS' ,'SIGN OUT'].map((text, index) => (
            <ListItem style={drawerStyles.listItem} button key={text}>
             {/*  <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon> */}
           {/*    <ListItemText style={drawerStyles.listitem} primary={text} /> */}
           {text}
            </ListItem>
             
          ))}
     
         </List>
        </Drawer>    
        
            <div style={videoStyles.videoContainer} >
               <div style = {videoStyles.videoInfo}><h4>  Date: {date} </h4> <br></br> Location : {location} <br></br> Camera : {camera}</div>
                <iframe style={videoStyles.video} width="700" height="400" src="https://295-videos.s3.us-east-2.amazonaws.com/San-Jose-16th-Oct-2019.mp4"></iframe>
            </div>
   
        </> 

        );
    }
}



export default Home;
